import { useState,useEffect} from 'react';

function App(props) {

  let [count, setCount] = useState(0);

  useEffect(() => {
    //书写你要执行的副作用，将会在组件渲染完成后执行
    document.title = `你惦记了${count}次`;
  })

  function clickHandle() {
    setCount(++count);
  }


  return (
    <div>
      <div>你点击了{count}次</div>

      <button onClick={clickHandle}>+1</button>
    </div>
  );
}

export default App;
